import React from 'react';



export default function Live ({liveSong, user}){
    console.log(liveSong)
    return (
        <div>
           {user == "admin"? <button className='quit'>quit</button>:null}
            { liveSong.map((line, index)=>(
               <p key={index}>
                { line.map((word, index)=>(
                   <>
                    <span>{word.chords}<sup key={index}>{ word.lyrics }  </sup></span>
                   </>
                ))}
               </p>
            ))}
        </div>
    );
};
